import React from 'react';

const Recipe = ({title,calories,yyeild,image}) => {
    return(
        <div>
            <h1>{title}</h1>
            <p>{calories} kcal</p>
            <p>{yyeild} Servings</p>
            <img src={image} alt=""/>
        </div>
    );
};

export default Recipe;
